import Login from "./pages/login";
import 'rsuite/dist/styles/rsuite-default.css';

function App() {
  const [loginDetails, setLoginDetails] = useState()
  return (
    <div className="App">
      <Login loginDetails={loginDetails} setLoginDetails={setLoginDetails}/>
    </div>
  );
}

export default App;
